(function() {
    'use strict';


    // define controllers
    var mainController = function($scope, geolocation, $modal, mediaCapture) {

        $scope.status = 'It works!';
        $scope.items = ['item1', 'item2', 'item3'];

        $scope.getLocation = function() {

            $modal.open({
                templateUrl: 'partials/modal.geolocation.html',
                controller: 'ModalInstanceCtrl',
                // size: size,
                resolve: {
                    result: function() {
                        return $scope.items;
                    },
                    // position: function() {
                    //     return geolocation.getCurrentPosition();
                    // },
                    camera: function() {
                        return mediaCapture.captureImage();
                    }


                }
            });
        };
    };

    var viewController = function($scope) {
        $scope.status = 'Also totally works!';
    };

    var navbarController = function() {};

    var modalController = function($scope, $modalInstance, items, camera) {
        $scope.cameraResult = JSON.stringify(camera);

        $scope.ok = function() {
            $modalInstance.close();
        };

        $scope.cancel = function() {
            $modalInstance.dismiss('cancel');
        };
    };

    var imageController = function($scope, mediaCapture, localFile) {

        console.log(':: ImageController call ::');

        $scope.carouselInterval = 5000;

        $scope.myInterval = 0;

        $scope.takenPhotos = [];

        $scope.lastPictureInfo = '';

        $scope.takePicture = function() {
            console.log('takePicture: ');

            /*
        $scope.takenPhotos.push("");
        */
            console.log('added: ' + $scope.takenPhotos.length);
            var result = mediaCapture.captureImage();
            result.then(function(images) {
                $scope.lastPictureInfo = JSON.stringify(images[0]);
                var base64 = localFile.readToData(images[0].fullPath.toString());
                base64.then(function(result) {
                    console.log('result of base64: ' + JSON.stringify(result.length));
                    $scope.takenPhotos.push(result.toString());
                });

                console.log('captured: ' + JSON.stringify(images));
                // for (var i = 0; i < images.length; i++) {
                //     $scope.lastPictureInfo = JSON.stringify(images[i]);
                //     var base64 = localFile.readToData(images[i].fullPath.toString());
                //     base64.then(function(result) {
                //         console.log('result of base64: ' + JSON.stringify(result.length));
                //         $scope.takenPhotos.push(result.toString());
                //     });

                //     // $scope.takenPhotos.push(images[i]);
                // }
                console.log('on takenPhotos: ' + $scope.takenPhotos.length);
            });
        };

    };

    // create instance of my module controllers
    var controllers = angular.module('myApp.controllers', ['ui.bootstrap'])
        .controller('MainCtrl', ['$scope', 'geolocation', '$modal', 'mediaCapture', mainController])
        .controller('ViewCtrl', ['$scope', viewController])
        .controller('NavBarCtrl', ['$scope', navbarController])
        .controller('ModalInstanceCtrl', ['$scope', '$modalInstance', 'result', /* 'position', */ 'camera', modalController])
        .controller('ImageCtrl', ['$scope', 'mediaCapture', 'localFile', imageController]);
    // .controller('ImageCtrl', imageController)


})();